fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_dam rdfs:subClassOf :dam ;
    :has_definition "A dam designed to control flooding. It normally holds back no water and allows the channel to flow freely, except during periods of intense flow that would otherwise cause flooding downstream."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:diversionary_dam rdfs:subClassOf :dam ;
    :has_definition "A dam designed to divert all or a portion of the flow of a river from its natural course."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:weapons_test_site rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "A region at which weapons, typically military, are tested."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:nuclear_weapons_test_site rdfs:subClassOf :weapons_test_site ;
    :has_definition "A weapons test site at which nuclear weapons are, or have been, tested."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:military_training_area rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_defence ],
        :anthropogenic_geographic_feature ;
    :has_definition "A region in which military personnel train."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:park rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :conservation_focused_active_ecosystem_management_process ;
                            rdf:rest [ rdf:first :usage_of_an_environment_for_recreation ;
                                    rdf:rest :nil ] ] ] ],
        :anthropogenic_geographic_feature ;
    :has_definition "A bounded area of land, or water, usually in its natural or semi-natural (landscaped) state and set aside for some purpose, usually to do with recreation or conservation."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:pier rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :water_body ],
        :transport_feature ;
    :has_definition "A raised walkway over water, supported by piles or pillars."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:archeological_site rdfs:subClassOf :site ;
    :has_definition "A place (or group of physical sites) in which evidence of past activity is preserved (either prehistoric or historic or contemporary), and which is, has been, or may be, investigated using the discipline of archaeology."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sports_facility rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_recreation ],
        :human_construction ;
    :has_definition "A building or region where sports activities can be carried out."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:winter_sports_facility rdfs:subClassOf :sports_facility ;
    :has_definition "A sports facility constructed for skiing and allied sports that require snow and/or ice."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:calanque rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :limestone ],
        :valley ;
    :has_definition "A deep valley with steep sides, typically of limestone, in part submerged by the sea."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:city rdfs:subClassOf :dense_settlement ;
    :has_broad_synonym "urban area"^^xsd:string ;
    :has_definition "Incorporated populated place."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:freshwater_biome rdfs:subClassOf :aquatic_biome,
        :freshwater_ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aquatic_biome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_body ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :fresh_water ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An aquatic biome which is determined by a body of freshwater."^^xsd:string ;
    :has_related_synonym "freshwater realm"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:large_river_biome rdfs:subClassOf :freshwater_river_biome ;
    :has_definition "A freshwater river biome which is determined by a large river."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:large_river_headwater_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :large_river_biome ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :headwater ],
        :freshwater_river_biome ;
    :has_definition "A freshwater river biome which is determined by the headwaters of a large river."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:large_river_delta_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :delta ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :large_river_biome ],
        :freshwater_river_biome ;
    :has_definition "A freshwater river biome which is determined by the delta of a large river."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_river_biome rdfs:subClassOf :freshwater_river_biome ;
    :has_definition "A freshwater river biome which is determined by a small river."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:large_freshwater_lake_biome rdfs:subClassOf :freshwater_lake_biome ;
    :has_definition "A freshwater biome which is determined by a large lake."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_freshwater_lake_biome rdfs:subClassOf :freshwater_lake_biome ;
    :has_definition "A freshwater lake biome which is determined by a small lake."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:xeric_basin_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :freshwater_spring ],
        :freshwater_biome ;
    :has_definition "A biome which has little permanent surface water and a low relative abundance of springs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:rock rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :hard ],
        :solid_environmental_material ;
    owl:disjointWith :mineral_material ;
    :has_definition "A rock is a naturally occurring solid aggregate of one or more minerals or mineraloids."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:mine_drainage rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mine ],
        :watercourse ;
    :has_definition "The outflow of water from a mine."^^xsd:string ;
    :has_related_synonym "acid and metalliferous drainage",
        "acid rock drainage" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:acid_mine_drainage rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :acidic ],
        :mine_drainage ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mine_drainage ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :acidic ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A mine drainage with an acidic pH."^^xsd:string ;
    :has_related_synonym "acid rock drainage"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :clay ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :sand ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :silt ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :chemical_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_role ;
                                            owl:someValuesFrom :nutrient ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :mineral_material ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :pedosphere ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :porous ],
        [ a owl:Restriction ;
            owl:onProperty :has_disposition ;
            owl:someValuesFrom :water_holding_capacity_of_soil ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :organic_material ],
        :environmental_material ;
    :has_broad_synonym "regolith" ;
    :has_definition "An environmental material which is primarily composed of minerals, varying proportions of sand, silt, and clay, organic material such as humus, interstitial gases, liquids, and a broad range of resident micro- and macroorganisms."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:marine_water_body rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :marine_biome ],
        :hydroform,
        :lentic_water_body ;
    :has_definition "A significant accumulation of water which is part of a marine biome."^^xsd:string ;
    :has_exact_synonym "body of marine water"^^xsd:string,
        "marine waterbody"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:slope rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :sloped ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :elevated_landform ;
                            rdf:rest [ rdf:first :depressed_landform ;
                                    rdf:rest :nil ] ] ] ],
        :landform ;
    :has_definition "A solid astronomical body part which is part of the planetary surface between the peak of an elevation or the bottom of a depression and relatively flat surrounding land."^^xsd:string ;
    :has_related_synonym "flank"^^xsd:string,
        "side"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:waste_water rdfs:subClassOf :contaminated_water,
        :waste_material ;
    :has_definition "Water that has been adversely affected in quality by anthropogenic influence."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:fecal_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :feces ],
        :excreta_material ;
    :has_definition "An excreta material which is composed primarily of feces, an excreta consisting of waste products expelled from an animal's digestive tract through the anus (or cloaca) during defecation."^^xsd:string ;
    :has_exact_synonym "faeces material"^^xsd:string,
        "feces material" ;
    :has_related_synonym "droppings"^^xsd:string,
        "frass"^^xsd:string,
        "pellet"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:air rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :carbon_dioxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :dinitrogen ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :dioxygen ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :argon_molecular_entity ],
        :gaseous_environmental_material ;
    :has_definition "The mixture of gases (roughly (by molar content/volume: 78% nitrogen, 20.95% oxygen, 0.93% argon, 0.038% carbon dioxide, trace amounts of other gases, and a variable amount (average around 1%) of water vapor) that surrounds the planet Earth."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:liquid_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water ],
        :liquid_environmental_material ;
    :has_broad_synonym "water" ;
    :has_definition "An environmental material primarily composed of dihydrogen oxide in its liquid form."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sediment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :granular ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :porous ],
        :environmental_material ;
    :has_definition "Sediment is an environmental substance comprised of any particulate matter that can be transported by fluid flow and which eventually is deposited as a layer of solid particles on the bedor bottom of a body of water or other liquid."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dry ],
        :particulate_environmental_material,
        :solid_environmental_material ;
    :has_definition "Particulate environmental material with diameters less than 500 micrometers."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:saline_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :sodium_chloride ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_osmolarity ],
        :liquid_water ;
    :has_definition "Water which contains a significant concentration of dissolved salts." ;
    :has_exact_synonym "salt water"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fresh_water rdfs:subClassOf :liquid_water ;
    :has_definition "Water which has a low concentration of dissolved solutes, particularly that of sodium chloride." ;
    :has_exact_synonym "freshwater" ;
    :has_related_synonym "sweet water" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersaline_water rdfs:subClassOf :saline_water ;
    :has_definition "Water which contains a highly increased concentration of dissolved salts, surpassing the average salinity of seawater." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:igneous_rock rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :lava ],
        :rock ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :rock ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :lava ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Rock formed from molten magma."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:plutonic_rock rdfs:subClassOf :igneous_rock ;
    :has_definition "An igneous rock that results from the crystallization of a magma below the surface of the Earth."^^xsd:string ;
    :has_related_synonym "intrusive rock"^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:volcanic_rock rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :rock ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :rock ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :formed_as_result_of ;
                                    owl:someValuesFrom :volcanic_eruption ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An igneous rock that results from magma reaching the surface either as lava or fragmental ejecta."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sedimentary_rock rdfs:subClassOf :rock ;
    :has_definition "A rock formed by deposition of either clastic sediments, organic matter, or chemical precipitates (evaporites), followed by compaction of the particulate matter and cementation during diagenesis."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:metamorphic_rock rdfs:subClassOf :rock ;
    :has_definition "A rock formed by subjecting any rock type (including previously-formed metamorphic rock) to different temperature and pressure conditions than those in which the original rock was formed. These temperatures and pressures are always higher than those at the Earth's surface and must be sufficiently high so as to change the original minerals into other mineral types or else into other forms of the same minerals (e.g. by recrystallisation)."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sewage rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :animal_waste_material ],
        :waste_water ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :waste_water ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :animal_waste_material ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Wastewater that is contaminated with feces or urine,"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brackish_water rdfs:subClassOf :saline_water ;
    :has_definition "Water which has a higher salinity than fresh water but a lower salinity than marine water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aquatic_biome rdfs:subClassOf :aquatic_ecosystem,
        :biome ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :biome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :water_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A biome which is determined by a water body and which has ecological climax communities adapted to life in or on water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carcass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :anatomical_entity ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :dead ],
        :organic_object ;
    :has_definition "The dead body of an animal."^^xsd:string ;
    :has_related_synonym "corpse"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
