@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:chicken_breeding_waste_material rdfs:subClassOf :agricultural_waste_material ;
    :has_broad_synonym "chicken breeding waste" ;
    :has_related_synonym "chicken yard waste"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:industrial_waste_material rdfs:subClassOf :waste_material ;
    :has_broad_synonym "industrial waste" ;
    :has_definition "Industrial wastes are liquid, solid and gaseous wastes originating from the manufacture of specific products."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:sphagnum_bog rdfs:subClassOf :peatland ;
    :has_definition "A peatland dominated by species of the Bryophyte Sphagnum."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:thermocline rdfs:subClassOf :fluid_cline ;
    :has_definition "A cline across which temperature changes rapidly."^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:chemocline rdfs:subClassOf :fluid_cline ;
    :has_definition "A cline across which the chemical composition of a fluid changes rapidly."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nuclear_power_plant rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :capable_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :anthropogenic_generation_of_energy ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :realizes ;
                                            owl:someValuesFrom :nuclear_energy ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :nuclear_power_reactor ],
        :power_plant ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :power_plant ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :capable_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :anthropogenic_generation_of_energy ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :realizes ;
                                                                    owl:someValuesFrom :nuclear_energy ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A nuclear power plant is a power plant which uses heat generated by a radioactive decay in a nuclear reactor to convert water into steam in order to drive turbines in electrical generators through pressure." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:waste_treatment_plant rdfs:subClassOf :industrial_building ;
    :has_exact_synonym "WWTP"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

