    :has_exact_synonym "sugarcane bagasse"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organic_waste_material rdfs:subClassOf :biological_waste_material ;
    :has_broad_synonym "organic waste" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

