            owl:onProperty :has_quality ;
            owl:someValuesFrom :hydrophobic ],
        :hydrocarbon_based_environmental_material,
        :liquid_environmental_material ;
    :has_definition "A nonpolar, hydrophobic, and lipophilic material which is a viscous liquid at ambient temperatures (about 20 degrees Celsius) or slightly warmer."^^xsd:string .

