                                    owl:onProperty :has_increased_levels_of ;
                                    owl:someValuesFrom :sarcosine ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A portion of sarcosine enriched soil is a portion of soil with elevated levels of sarcosine."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
